CREATE TABLE bc_photo.oauth_client_details
(
    client_id varchar(256) PRIMARY KEY NOT NULL,
    resource_ids varchar(256),
    client_secret varchar(256),
    scope varchar(256),
    authorized_grant_types varchar(256),
    web_server_redirect_uri varchar(256),
    authorities varchar(256),
    access_token_validity int(11),
    refresh_token_validity int(11),
    additional_information varchar(4096),
    autoapprove varchar(256)
);
CREATE TABLE bc_photo.photo_UserConnection
(
    userId varchar(255) NOT NULL,
    providerId varchar(255) NOT NULL,
    providerUserId varchar(255) NOT NULL,
    rank int(11) NOT NULL,
    displayName varchar(255),
    profileUrl varchar(512),
    imageUrl varchar(512),
    accessToken varchar(512) NOT NULL,
    secret varchar(512),
    refreshToken varchar(512),
    expireTime bigint(20),
    CONSTRAINT `PRIMARY` PRIMARY KEY (userId, providerId, providerUserId)
);
CREATE UNIQUE INDEX UserConnectionRank ON bc_photo.photo_UserConnection (userId, providerId, rank);
CREATE TABLE bc_photo.photo_address
(
    id bigint(20) unsigned PRIMARY KEY NOT NULL COMMENT '唯一标识' AUTO_INCREMENT,
    user_id bigint(20) NOT NULL COMMENT '用户id',
    name varchar(64) DEFAULT '' NOT NULL COMMENT '收货人姓名',
    phone varchar(32) DEFAULT '' NOT NULL COMMENT '手机号',
    address varchar(128) COMMENT '详细地址',
