CREATE TABLE bc_photo.photo_order
(
    id bigint(20) unsigned PRIMARY KEY NOT NULL COMMENT '唯一标识' AUTO_INCREMENT,
    sn varchar(32) DEFAULT '0' NOT NULL COMMENT '订单编号',
    order_amount decimal(10,2) DEFAULT '0.00' NOT NULL COMMENT '订单金额',
